import React from 'react';
import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './index.css';
import * as serviceWorker from './serviceWorker';
import App from './App';

ReactDOM.render(
  //<BrowserRouter>
    <App />
  //</BrowserRouter>
  ,
  document.getElementById('root')
);

